import { GitHub } from "@mui/icons-material";
import { LinkedIn } from "@mui/icons-material";

const BottomBar = () => {
    
    return (
        <div>
            <h1>Contact information!</h1>
            <br/>
            <a className="button-icons" href='https://github.com/ManishMallik'><GitHub/></a>
            <button className="button-icons"><LinkedIn/></button>
        </div>
    );
}

export default BottomBar;
